#include <cassert>

    
std::ostream&
operator<<( std::ostream &ostr, const MarketId &m )
{
    ostr << m.to4Code();
    return ostr;
}

std::istream&
operator>>( std::istream &istr, MarketId &m )
{
    std::string str;
    istr >> str;
    m.setMarketId( str );
    return istr;
}

//
//
//


bool
MarketId::setMarketId( const std::string &str )
// https://en.wikipedia.org/wiki/Binary_search_algorithm
{    
    // assert(str.size() == 4);
    if (str.size() != 4)
    {
        m_mic = MarketId::XXXX; // NOMARKET
        return false;
    }
  
    // mics begining in numbers (or any character that precedes 'A' in the ASCII table)
    // are grouped together in the '@' = ('A' - 1) bucket, note that '@' = 64, 'A' = 65;
    const int index =  std::max('@', str[0]) - '@'; 

    //assert(index > -1 && index < 27);
    if (index < 0 || index > 26)
    {
        m_mic = MarketId::XXXX;
        return false;
    }
    
    int low   = m_search[index];
    int high  = m_search[index + 1]; 
    int mid = ((high + low) >> 1); // divide by 2 (quickly)
    int i;
    
    while (low < high) 
    {        
        const char * const mic = m_codes[mid];
        
        for (i = 1; i < 4; ++i)
        {
            const char &a = str[i];
            const char &b = mic[i];
            
            if (a < b)
            {
                high = mid; 
                break;
            }
            
            if (a > b)
            {
                low = mid + 1;
                break;
            }
        }
        
        if (i == 4)
        {
            m_mic = m_toISO[mid]; 
            return true;
        }
        
        mid = ((high + low) >> 1);
    }
    
    m_mic = MarketId::XXXX; // NOMARKET
    return false;
} 

